import React from 'react';

const Home = () => {
    return (
        <div>
            <h1>CUNY Students Matter</h1>
            <p>Did you know that CUNY provides resources to help students with basic needs such as food, housing, mental health and many more?</p>
        </div>
    );
}

export default Home;
